Step-by-step reasoning:
1. In the Fehr‐Schmidt model, each individual’s utility is their own monetary payoff minus a penalty for inequity. In the standard formulation, there are two penalties: one for disadvantageous inequality (envy) and one for advantageous inequality (guilt). However, because in this dataset the participant’s share (split_self) is always higher than the opponent’s (split_opp) in contexts relevant for acceptance, the inequality penalty only applies when the responder receives more than the opponent.
2. Thus, we can simplify the model to only include the penalty for advantageous inequality. For a responder, the utility of accepting an offer is their monetary gain (split_self) minus a fairness penalty proportional to the difference (split_self – split_opp) if that difference is positive.
3. Mathematically, we capture this with a max function, so that the penalty is applied only when the participant’s share exceeds the opponent’s.
4. The only learnable parameter is beta (β), which scales the fairness penalty. We choose finite bounds for beta (e.g., [0, 10]) to ensure identifiability and avoid high covariance issues during parameter recovery.
5. The mapping to observable data: The utility U_accept is computed from the offer splits (split_self, split_opp) available in the data. A lower utility (potentially negative) corresponds to a less attractive offer that is more likely to be rejected.

Below is the formal model specification and variable descriptions:

<MODEL>
U_accept = split_self - beta * max(split_self - split_opp, 0)
</MODEL>

<VARIABLES>
