  "variables": {
    "U_accept": {
      "description": "Utility of accepting the offer for the responder",
      "range": {
        "min": "-inf",
        "max": "inf",
        "inclusive_min": false,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "calculated"
    },
    "split_self": {
      "description": "Proposed share for the participant (in £)",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "split_opp": {
      "description": "Proposed share for the opponent (in £)",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "beta": {
      "description": "Inequality aversion parameter for advantageous inequality",
      "range": {
        "min": 0,
        "max": 10,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    }
  }
}
</VARIABLES>

<SUMMARY>
A Fehr-Schmidt utility model for responders that computes the utility of accepting an offer as the monetary share for the participant reduced by a penalty proportional to the advantageous inequality (the excess of split_self over split_opp), governed by a single learnable parameter beta.
</SUMMARY>

